# 2. Reformat function
    # Used to change the resulting data frame from long to wide format for easier data processing
    # It also converts the date-time field to just a date field.
    # This function was NOT called for the sensitivity analysis in which only 1 monthly sample was pulled

    # Input:  dataframe (long format)
    # Output: dataframe (wide format)
########################


def reformatFile(df):
    # use pandas built in pivot to change general format from long to wide
    df = df.pivot(index='timestamp', columns='sample', values='value')
    # rename columns by appending "sample_" as a prefix to each
    df.columns = ["sample_" + str(col) for col in df.columns]
    # create column name to hold each time period
    df.index.name = "period"
    # move time period values from index list to actual column inside df
    df.reset_index(inplace=True)
    # convert from date_time to just date
    df['period'] = df['period'].dt.date
    return df


